(defn run
  [archive-size initial-zeitgeist]

  (let [size-limit 80
        min-size 15
        ea-config (spea2/spea2-config
                    {:goals [:error :complexity]
                     :archive-size archive-size
                     :binary-ops [{:op (partial genetics/ninety-ten-sl-crossover size-limit) :repeat 23}]
                     :unary-ops [{:op (partial genetics/random-tree-mutation functions terminals 3) :repeat 4}]})
        score-functions {:complexity tree/count-nodes
                         :error (fn [ex] (score/abs-error vars coords data ex))}
        generation-config {:ea-config              ea-config
                           :score-functions        score-functions
                           :reporting-function     (fn [z] (flush))}


        result1 (evolution/run-evolution generation-config initial-zeitgeist (fn [zg gc] (>= (:age zg) 200)))]
    (:error (nth (sort-by :complexity > (:elite result1)) 0))
    ;;(plot/compose
    ;;(plot/list-plot data :plot-range [:all :all])
    ;;(plot/list-plot (interpreter/evaluate (:genotype (nth (sort-by :complexity > (:elite result1)) 0))
    ;;                                      '[x]
    ;;                                      coords) :joined true))
    )
  )
